description:
Cần bán nhà 5 tầng tại TT Trâu Quỳ, Gia Lâm, Hà Nội:
- Dt 30m, mt 5m rất thoáng khi thiết kế nhà;
- Nhà xây 5 tầng: 3PN, 4WC, phòng thờ sân phơi riêng biệt;
- Ngay sát cạnh hàng xóm Vin Oceanpark;
- Trung tâm Thị trấn;
- Di chuyển qua các cầu Chương Dương, Vĩnh Tuy chỉ mất 15p chạy xe
- Sổ hồng sang tên;
- Giá chỉ 4.5 tỷ có thương lượng;
LH em qua sdt/zl để xem 24/7
